def main():
    rr = []
    while True:
        w,d = LI()
        if w == 0:
            break
        a = sorted(LI())
        b = sorted(LI())
        ai = 0
        bi = 0
        r = 0
        while ai < w or bi < d:
            if ai >= w:
                r += sum(b[bi:])
                break
            if bi >= d:
                r += sum(a[ai:])
                break
            if a[ai] == b[bi]:
                r += a[ai]
                ai += 1
                bi += 1
            elif a[ai] < b[bi]:
                r += a[ai]
                ai += 1
            else:
                r += b[bi]
                bi += 1
        rr.append(r)

    return '\n'.join(map(str, rr))

